 def get_db_file_date(p_db_name: org.apache.spark.sql.Column, p_file_date_format: org.apache.spark.sql.Column, p_landing_structure: org.apache.spark.sql.Column) = {
  var v_file_name: org.apache.spark.sql.Column = element_at(split(p_db_name, "\\."), lit(1))
var v_file_date: org.apache.spark.sql.Column = when(p_landing_structure === lit("PARTITION"), string_substring(v_file_name, string_rindex(v_file_name.cast(StringType), lit("=")) + lit(1), lit(1000))).otherwise(string_substring(v_file_name, string_rindex(v_file_name.cast(StringType), lit("_")) + lit(1), lit(1000)))
var v_file_date_format_vec: org.apache.spark.sql.Column = string_split_no_empty(p_file_date_format.cast(StringType), lit("|"))
when(array_contains(v_file_date_format_vec, lit("YYYYMMDD")) and (string_length(v_file_date) === lit(8)), v_file_date).when(array_contains(v_file_date_format_vec, lit("YYYYMM")) and (string_length(v_file_date) === lit(6)), concat(v_file_date, lit("01"))).when(array_contains(v_file_date_format_vec, lit("DDMMYYYY")) and (string_length(v_file_date) === lit(8)), date_format(to_date(v_file_date, "ddMMyyyy"), "yyyyMMdd").cast(StringType)).when(array_contains(v_file_date_format_vec, lit("YYYY-MM-DD")) and (string_length(v_file_date) === lit(10)), date_format(to_date(v_file_date, "yyyy-MM-dd"), "yyyyMMdd").cast(StringType)).otherwise(v_file_date)
}

